INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'webform', 0, 1, 1, 'und', 0, '<p><strong>Central Laundry Equipment, Inc.&nbsp;<br>P.O. Box 324<br>Ward, Arkansas 72176<br>1-800-467-3194</strong></p><p><strong>Additional Locations:</strong><br>Rogers, Arkansas<br>Memphis, Tennessee</p><p><span style="color: #455560;"><strong>General Manager</strong></span><br>Jeff Craig</p><p><span style="color: #455560;"><strong>Sales Manager</strong></span><br>Mark DeJesus</p><p><span style="color: #455560;"><strong>Service Manager</strong></span><br>Neal Schoeller</p><p><span style="color: #455560;"><strong>Parts Manager</strong></span><br>Sandy Phillips</p><p>&nbsp;</p>', '', 'full_html'),
('node', 'webform', 0, 2, 2, 'und', 0, '<p>* Fully stocked service trucks for same-day repair</p><p>* Factory-trained service technicians</p><p>* Over 50 years of combined experience</p><p>* Servicing for all major brands&nbsp;</p><p>* Lower service call rates</p><p>* Service office in Northwest Arkansas</p><p>* Service office in Memphis, TN</p><p><img src="http://localhost/cle/themes/bartik/images/request_machine.png"></p>', '', 'full_html'),
('node', 'page', 0, 3, 3, 'und', 0, '<div id="home"><div class="left"><img src="http://localhost/cle/themes/bartik/images/home_machine.png"></div><div class="right"><div class="title">WHO WE ARE</div><p>Central Laundry Equipment, Inc. was formed in 1985 and incorporated in 1986 in Ward, Arkansas by Richard &amp; Pat Bradshaw. Our company was established on the principles of customer service and continues this principle today giving our customers the best of the best in service.</p><div class="title">WHAT WE DO</div><p>Central Laundry Equipment, Inc. offers top of the line UniMac laundry equipment. We have a knowledgeable sales staff that understands your needs, making sure you receive the proper equipment at the best value. We provide laundry room layout, design, and consulting at no additional cost. Our factory certified technicians will provide friendly, prompt service at an affordable rate. We have a full service parts department stocked with genuine OEM parts, ready to ship within 24 hours. With locations in Ward, Arkansas, Rogers, Arkansas, and Memphis, Tennessee we are ready to assist you with all your laundry needs.</p></div></div>', '', 'full_html'),
('node', 'product', 0, 4, 4, 'und', 0, '<p>UniMac has been recognized around the world as the leading manufacturer of commercial</p><p>laundry equipment. Our value line washer-extractors are renowned for their durability, innovative features, efficient performance and lowest cost of ownership.</p>', '', 'full_html'),
('node', 'product', 0, 5, 5, 'und', 0, '<p>Our UW washer-extractors are renowned for their durability, innovative features and industrial</p><p>strength. Our new Value Line of UW45 &amp; 65 models will provide you with exactly that – all while fitting your budget.&nbsp;</p>', '', 'full_html'),
('node', 'product', 0, 6, 6, 'und', 0, '<p>UniMac UW models utilize an advanced water management system that has the lowest water usage of any manufacturer, and we lower it even further with 30 programmable water levels to decrease water usage.&nbsp;</p><p>This can help you save thousands of gallons of water each year.</p>', '', 'full_html'),
('node', 'product', 0, 7, 7, 'und', 0, '<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. ls.</p>', '', 'full_html'),
('node', 'product', 0, 8, 8, 'und', 0, '<p>When it comes to your machine lasting longer and looking good, the difference is in the details. And that’swhere UniMac shines.&nbsp;</p><p>&nbsp;Constructed of high-grade steel,</p><p>our heavy-duty door and two-point hinges will stand up to the toughest laundry conditions.</p>', '', 'full_html'),
('node', 'product', 0, 9, 9, 'und', 0, '<p>UniMac’s enclosed heat system boosts efficiency and helps you keep your laundry environment more comfortable. Energy costs and drying times are reduced because radiant heat from the stove top is used to preheat intake air before it enters the combustion chamber.</p>', '', 'full_html'),
('node', 'product', 0, 10, 10, 'und', 0, '<p>UniMac washer-extractors feature who close-tolerance ball bearings, permanently lubricated for trouble-free operation.&nbsp;</p><p>Excluder seal and two triple-lip seals provide seven times the sealing power to isolate the bearings from water and chemicals.</p>', '', 'full_html'),
('node', 'product', 0, 11, 11, 'und', 0, '<p>Our Super High 300 G-Force Extraction removes water with more power than the competition’s 86 G-Force machines, equalizing wash and dry times and allowing your</p><p>laundry to run at maximum&nbsp;</p><p>efficiency.</p>', '', 'full_html'),
('node', 'product', 0, 12, 12, 'und', 0, '<p>OPTidry is an industry-exclusive, cutting-edge innovation that connects sensors located within the lifters to our revolutionary rotary transfer switch to offer unmatched levels of accuracy. The result is a pinpoint dryness reading throughout the entire load, eliminating costs associated with over-drying.</p>', '', 'full_html'),
('node', 'product', 0, 13, 13, 'und', 0, '<p>Featuring solid steel construction and heavy-duty precision bearings,</p><p>our line of UX washer-extractors consistently achieve high levels of</p><p>efficiency, quality and durability.</p>', '', 'full_html'),
('node', 'product', 0, 14, 14, 'und', 0, '<p>The Fireman’s Personal Protective Equipment (PPE) Drying Cabinet provides fire stations the means to effectively, efficiently and safely dry protective gear – at the lowest cost of ownership in the industry.</p>', '', 'full_html');
