(2, 'node', ' service request  fully stocked service trucks for sameday repair factorytrained service technicians over 50 years of combined experience servicing for all major brands lower service call rates service office in northwest arkansas service office in memphis tn business name contact name phone email address city state product type model number message  ', 0),
(3, 'node', ' home who we are central laundry equipment inc was formed in 1985 and incorporated in 1986 in ward arkansas by richard pat bradshaw our company was established on the principles of customer service and continues this principle today giving our customers the best of the best in service what we do central laundry equipment inc offers top of the line unimac laundry equipment we have a knowledgeable sales staff that understands your needs making sure you receive the proper equipment at the best value we provide laundry room layout design and consulting at no additional cost our factory certified technicians will provide friendly prompt service at an affordable rate we have a full service parts department stocked with genuine oem parts ready to ship within 24 hours with locations in ward arkansas rogers arkansas and memphis tennessee we are ready to assist you with all your laundry needs  ', 0),
(4, 'node', ' unimac value line unimac has been recognized around the world as the leading manufacturer of commercial laundry equipment our value line washerextractors are renowned for their durability innovative features efficient performance and lowest cost of ownership waselenium2pdfpdf ', 0),
(5, 'node', ' new unimac value line our uw washerextractors are renowned for their durability innovative features and industrial strength our new value line of uw45 65 models will provide you with exactly that all while fitting your budget  ', 0),
(6, 'node', ' new unimac high efficiency washer unimac uw models utilize an advanced water management system that has the lowest water usage of any manufacturer and we lower it even further with 30 programmable water levels to decrease water usage this can help you save thousands of gallons of water each year  ', 0),
(7, 'node', ' unimac small equip line lorem ipsum dolor sit amet consetetur sadipscing elitr sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat sed diam voluptua at vero eos et accusam et justo duo dolores et ea rebum ls  ', 0),
(8, 'node', ' unimac dryer 5075lb when it comes to your machine lasting longer and looking good the difference is in the details and that swhere unimac shines constructed of highgrade steel our heavyduty door and twopoint hinges will stand up to the toughest laundry conditions qao6d6hcwzkjpg ', 0),
(9, 'node', ' unimac dryer 120170lb unimac s enclosed heat system boosts efficiency and helps you keep your laundry environment more comfortable energy costs and drying times are reduced because radiant heat from the stove top is used to preheat intake air before it enters the combustion chamber  ', 0),
(10, 'node', ' unimac uc series unimac washerextractors feature who closetolerance ball bearings permanently lubricated for troublefree operation excluder seal and two triplelip seals provide seven times the sealing power to isolate the bearings from water and chemicals  ', 0),
(11, 'node', ' unimac high efficiency washer our super high 300 gforce extraction removes water with more power than the competition s 86 gforce machines equalizing wash and dry times and allowing your laundry to run at maximum efficiency d9o7zmmqk4jpg ', 0),
(12, 'node', ' unimac high efficiency dryer optidry is an industryexclusive cuttingedge innovation that connects sensors located within the lifters to our revolutionary rotary transfer switch to offer unmatched levels of accuracy the result is a pinpoint dryness reading throughout the entire load eliminating costs associated with overdrying  ', 0),
(13, 'node', ' unimac softmount featuring solid steel construction and heavyduty precision bearings our line of ux washerextractors consistently achieve high levels of efficiency quality and durability  ', 0),
